            await newUser.save();
            return newUser;
        },
        deleteUser: async(root, {_id}) => {
            const user = await User.findByIdAndRemove(_id);
            return user;
        },
        editUser: async(root, {_id, firstName, lastName, email, password}) => {
            const user = await User.findOneAndUpdate(_id, {
                firstName,
                lastName,
                email,
                password,
            }, {new: true});
            return user;
        },
    }
}

